description:
Вимоги до кваліфікації учасників торгів, технічні вимоги на заправлення та відновлення картриджів та основні умови виконання зобов’язань замовника та виконавця послуг:

1. Послуга заправки/відновлення здійснюється частинами в кількості від одного картриджа в залежності від поточних потреб замовника виключно у сервісному центрі виконавця;
2. У вартість заправки картриджа мають входити наступні витратні матеріали: тонер, лезо дозування магнітного валу, лезо ущільнення, чип картриджа (за необхідністю), а також такі послуги: технічне обстеження, чистка картриджа від зайвого тонеру спеціалізованим обладнанням, засипка в картридж нового тонера, заміна чи перепрограмування чипа (за необхідністю), тестування заправленого картриджа та кур’єрська доставка («двері-двері») пустих картриджів від замовника до сервісного центру, а також заправлених картриджів від сервісного центру до замовника.
3. У вартість відновлення картриджа мають входити наступні витратні матеріали: тонер, фотобарабан, лезо очищення фотобарабану, магнітний вал та вал первинного заряду, а також такі послуги: технічне обстеження, чистка картриджа від зайвого тонеру спеціалізованим обладнанням, заміна необхідних запчастин, засипка в картридж нового тонера, заміна чи перепрограмування чипа (за необхідністю), тестування заправленого картриджа та кур’єрська доставка («двері-двері») несправних картриджів від замовника до сервісного центру, а також відновлених картриджів від сервісного центру до замовника.
4. Заправка та відновлення картриджів здійснюється з використанням оригінальних витратних матеріалів та запчастин. На вимогу замовника виконавець протягом робочого дня зобов’язаний надати документи, що підтверджують заправку та відновлення картриджів з використанням оригінальних витратних матеріалів та запчастин.
5. Заправлений картридж має відпрацьовувати заявлений виробником картриджів ресурс.
6. Термін надання послуги (частини) не повинен перевищувати 1 доби;
7. Виконавець повертає картриджі у світлозахисній упаковці;
8. Картриджі маркуються стікерами із зазначенням дати надання послуги;
9. У разі виявлення недоліків по якості Виконавець повинен усунути їх за власний рахунок протягом 1 робочого дня.
10. Оплата здійснюється за актами виконаних послуг після отримання замовником фінансування з бюджету, при цьому виконавець погоджується на можливий термін відстрочки платежу до 180 календарних днів.
11. Учасник повинен надати в електронному (сканованому) вигляді в складі своєї пропозиції наступні документи :
- копія свідоцтва про державну реєстрацію або копію витягу або виписки з Єдиного державного реєстру юридичних осіб та фізичних осіб-підприємців;
- копія свідоцтва про реєстрацію платника ПДВ або витягу з реєстру платників ПДВ (якщо Учасник є платником ПДВ) або платника єдиного податку (якщо Учасник є платником єдиного податку);
- контактні дані компанії-учасника (з зазначенням реквізитів учасника: назви, коду ЄДРПОУ, місцезнаходження, поштової адреси, телефону,  електронної адреси; відомостей про контактну особу (прізвище, ім’я, по-батькові, посада, контактний телефон)).
Документи, що підтверджують відповідність вимогам до кваліфікації учасників та копія статуту (іншого установчого документу, а також іншого документу (за наявності), що підтверджують правомочність на укладення договору про закупівлю послуг), в паперовому вигляді, завірені підписом та печаткою учасника, надаються замовнику переможцем під час укладання договору про закупівлю
